function vaelgListe(qstr)
{
	if (qstr == "6"){return 6;}
	if (qstr == "5"){return 5;}
	if (qstr == "4"){return 4;}
	if (qstr == "3"){return 3;}
	if (qstr == "2"){return 2;}
	if (qstr == "1"){return 1;}
	if (qstr == "0"){return 0;}
	return 5;
}

}

	}
}
function clearPage()
{
    {
		var i = 30001;//offset
		for (let j = 30001; j < 30602; j++) 
			{UnSetImg(i++);}
		//document.getElementById("billedtekst").innerHTML = GetObjectValue(data1.Lists[0].ListData[1].title, "title findes ikke");
	}
}
function getJsonArrayListName(arr,id)
{
	var s = arr.length.toString(10);
    if ( arr !== undefined && arr !== null )
    {
		for(let idx in arr) {
			if ( arr[idx].ListId == id )
			{
				s = s + '*';
			}
			s = s + ' ' + idx.toString(10) + '-' + arr[idx].ListId.toString(10) + '-' + arr[idx].ListData.length.toString(10);
		}
	}
	return s;
}
function getJsonArrayTitle(arr)
{
	var s = arr.length.toString(10);
    if (arr !== undefined && arr !== null )
    {
		for (let idx = 0; idx < arr.length; idx++) 
		{
			s = s + ' ' + idx.toString(10) + '-' + arr[idx].title;
		}
	}
	return s;
}
function getJsonListIdx(arr, id)
{
	var n = -3;
    if ( arr !== undefined && arr !== null )
    {
		n = -2;
		for (let idx = 0; idx < arr.length; idx++) 
		{
			if (arr[idx].ListId == id)
			{
				n = idx;
			}
		}
	}
	return n;
}

function loadJsonArray(arr, offset)
{
	var i = offset;
    if ( arr !== undefined && arr !== null )
    {
		for (let idx = 0; idx < arr.length; idx++) 
		{
			SetImg3(i++, arr[idx].title, arr[idx].src, arr[idx].name);
		}
	}
}
function SetImg3(id, title, src, name )
{
	o = document.getElementById(id);
    if ( o !== undefined && o !== null )
	{
	    //o.onclick =  "javascript:viewPic(this)";
		o.width = 60;
		o.title = GetObjectValue(title, "");
		o.src = GetObjectValue(src, "");
		o.name = GetObjectValue(name, "");
		o.border = 1;
	}
}
function UnSetImg(id)
{
	o = document.getElementById(id);
    if ( o !== undefined && o !== null )
	{
	    //o.onclick =  "javascript:viewPic(this)";
		o.width = 0;
		o.title = undefined;
		o.src = "ecblank60.gif";
		o.src = undefined;
		o.name = undefined;
		o.border = 0;
	}
}

document.addEventListener("DOMContentLoaded", function(event) {
